// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title DocumentRegistry
 * @dev A registry for decentralized document metadata.
 * Stores IPFS hashes and ownership information on-chain.
 */
contract DocumentRegistry is Ownable {
    struct DocumentMetadata {
        string ipfsHash;
        string name;
        address owner;
        uint256 timestamp;
        uint256 version;
    }

    // Mapping from IPFS Hash to Document metadata
    mapping(string => DocumentMetadata) private documents;

    // Mapping to track if a document hash exists
    mapping(string => bool) private hashExists;

    // Events
    event DocumentRegistered(string indexed ipfsHash, address indexed owner, string name);
    event DocumentUpdated(string indexed ipfsHash, address indexed owner, uint256 version);

    /**
     * @dev Constructor sets the initial owner of the registry.
