    /**
     * @dev Registers a new document on the blockchain.
     * @param _ipfsHash The content-addressable hash from IPFS.
     * @param _name Human-readable name of the document.
     */
    function registerDocument(string memory _ipfsHash, string memory _name) public {
        require(bytes(_ipfsHash).length > 0, "IPFS hash is required");
        require(!hashExists[_ipfsHash], "Document already registered");

        documents[_ipfsHash] = DocumentMetadata({
            ipfsHash: _ipfsHash,
            name: _name,
            owner: msg.sender,
            timestamp: block.timestamp,
            version: 1
        });

        hashExists[_ipfsHash] = true;

        emit DocumentRegistered(_ipfsHash, msg.sender, _name);
    }

    /**
     * @dev Updates an existing document (e.g., re-upload or metadata change).
     * Only the owner can update.
     * @param _ipfsHash The hash of the document to update.
     */
    function updateDocument(string memory _ipfsHash) public {
        require(hashExists[_ipfsHash], "Document not found");
        require(documents[_ipfsHash].owner == msg.sender, "Not the document owner");

        documents[_ipfsHash].version += 1;
        documents[_ipfsHash].timestamp = block.timestamp;

        emit DocumentUpdated(_ipfsHash, msg.sender, documents[_ipfsHash].version);
    }

    /**
     * @dev Retrieves document metadata.
     * @param _ipfsHash The IPFS hash of the document.
     */
    function getDocument(string memory _ipfsHash) public view returns (
        string memory ipfsHash,
        string memory name,
        address owner,
        uint256 timestamp,
        uint256 version
    ) {
        require(hashExists[_ipfsHash], "Document not found");
        DocumentMetadata memory doc = documents[_ipfsHash];
        return (doc.ipfsHash, doc.name, doc.owner, doc.timestamp, doc.version);
    }
}

